import React from 'react'
import { useState } from 'react';
import { Link } from 'react-router-dom';
const Register = () => {

  const [formData, setFormData] = useState({
    firstname:'',
    lastname:'',
    username: '',
    email: '',
    password: '',
  });

  // Handle form field changes
  // const handleChange = (e) => {
  //   const { name, value } = e.target;
  //   setFormData({ ...formData, [name]: value });
  // };
  const handleSubmit = async (e) => {
    e.preventDefault();

    // API endpoint for user registration
    const registrationEndpoint = 'http://localhost/API/register.php'; // Replace with your actual API endpoint

    try {
      const response = await fetch(registrationEndpoint, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });
        console.log(response);
      if (response.ok) {
        // Registration successful
        const logindata=await response.json();
        console.log("@@@",logindata);
        console.log('User registered successfully!');
      } else if(response.error=="002"){
        // Registration failed
        console.error('User Already Exists');
      }else{
        console.log("Error encounters");
      }
    } catch (error) {
      console.error('An error occurred during registration:', error);
    }
  };
  return (
<section className="">
  <div className="px-4 py-5 px-md-5 text-center text-lg-start" style={{backgroundColor: "hsl(0, 0%, 96%)"}}>
    <div className="container">
      <div className="row gx-lg-5 align-items-center">
        <div className="col-lg-6 mb-5 mb-lg-0">
          <h1 className="my-5 display-3 fw-bold ls-tight">
           webApp <br />
            <span className="text-primary">Registration</span>
          </h1>
          <p style={{color: "hsl(217, 10%, 50.8%)"}}>
           
          </p>
        </div>

        <div className="col-lg-6 mb-5 mb-lg-0">
          <div className="card">
            <div className="card-body py-5 px-md-5">
              <form onSubmit={handleSubmit}>
                <div className="row">
                  <div className="col-md-6 mb-4">
                    <div data-mdb-input-init className="form-outline">
                      <input type="text" value={formData.firstname} onChange={(e) => setFormData(e.target.value)} id="form3Example1" className="form-control" />
                      <label className="form-label" for="form3Example1">First name</label>
                    </div>
                  </div>
                  <div className="col-md-6 mb-4">
                    <div data-mdb-input-init className="form-outline">
                      <input type="text" id="form3Example2" value={formData.lastname} onChange={(e) => setFormData(e.target.value)} className="form-control" />
                      <label className="form-label" for="form3Example2">Last name</label>
                    </div>
                  </div>
                </div>

               
                <div data-mdb-input-init className="form-outline mb-4">
                  <input type="email" id="form3Example3" value={formData.email} onChange={(e) => setFormData(e.target.value)} className="form-control" />
                  <label className="form-label" for="form3Example3">Email address</label>
                </div>

             
                <div data-mdb-input-init className="form-outline mb-4">
                  <input type="password" id="form3Example4" value={formData.password} onChange={(e) => setFormData(e.target.value)} className="form-control" />
                  <label className="form-label" for="form3Example4">Password</label>
                </div>

              
                {/* <div className="form-check d-flex justify-content-center mb-4">
                  <input className="form-check-input me-2" type="checkbox" value="" id="form2Example33" checked />
                  <label className="form-check-label" for="form2Example33">
                    Subscribe to our newsletter
                  </label>
                </div> */}

               
                <button type="submit" data-mdb-button-init data-mdb-ripple-init className="btn btn-primary btn-block mb-4">
                  Sign up
                </button>
                <div class="text-center">
                  <p>Sign In:</p>
                  <Link to="/" class="btn btn-primary">Login</Link>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  </div>
  
</section>

  )
}
export default Register;
